import classes from './Dialogs.module.css';

const Dialogs = (props) => {
  return (
    <div className={classes.dialogs}>
      <div className={classes.dialogsItems}>
        <div className={classes.dialog}>Irina</div>
        <div className={classes.dialog}>Victor</div>
        <div className={classes.dialog}>Yuriy</div>
        <div className={classes.dialog}>Olha</div>
        <div className={classes.dialog}>Yliana</div>
      </div>
      <div className={classes.messages}>
        <div className="message">hi!</div>
        <div className="message">How are you</div>
        <div className="message">What about your studing?</div> 
      </div>
    </div>
  )
}

export default Dialogs;
